{'id': 'AD3E8059-208A-4237-B786-FCD6F9EBD6C0', 'url': 'https://www.nps.gov/jela/planyourvisit/barataria-preserve.htm', 'name': 'Barataria Preserve', 'parkCode': 'jela', 'description': "With more than 26,000 acres of wild Louisiana wetlands, the Barataria Preserve's hardwood forest, swamp, bayous, and marsh offer trails, picnic areas, fishing, hunting (in season and with permits), and wildlife viewing. Visitor center films and exhibits explain the wetlands habitat and current environmental challenges; ranger programs are offered daily. Programs at the environmental education center are available by reservation. Admission to the preserve and to most programs is free.", 'latitude': '29.78395414779424', 'longitude': '-90.11552593624504', 'latLong': '{lat:29.78395414779424, lng:-90.11552593624504}', 'audioDescription': "The visitor center is accessed from the parking lot by a wooden ramp. The ramp begins at the sidewalk and is slightly inclined. The first section of the ramp is about 30 ft., then turns right about 40 degrees. The next section is about 35 ft., then turns right again about 30 degrees. This section is 40 ft. to the wooden deck in front of the visitor center. The deck is level. The visitor center is 40 ft. ahead. Entry is through glass doors into a small foyer then about 6 ft. to a second set of glass doors. The ranger's desk is directly ahead about 8 ft. To the right is a museum, with exhibits of the geology, biology, natural history, and human history of the Barataria region. The museum has a wide entrance and is about 20 ft. from the ranger's desk. The exhibits are along the walls and in a large island in the middle of the museum holding more exhibits. A few of the exhibits are equipped with sound; most are not. Also in the visitor center is a theater. Entry to the theater is through a door that is immediately to the right of the entrance. The theater is entered by making a right U-turn after entering the visitor center. The restrooms are outside the visitor center in a separate building. Leave the visitor center through the glass doors and turn sharply right. The building with the restrooms is about 40 ft. away. The men's room is the nearest on the left side of the building, and the women's restroom is on the right. In between are a large drinking fountain and entrance to a handicapped/family restroom. Also between the visitor center and the building with the restrooms are two picnic tables, both closer to the visitor center than to the restroom.", 'isPassportStampLocation': '1', 'passportStampLocationDescription': '', 'passportStampImages': [{'credit': '', 'description': '', 'crops': [{'aspectRatio': 1.0, 'url': 'https://www.nps.gov/common/uploads/passport_stamps/primary/FB67BF83-93C1-0972-9223670918D28875.jpg'}], 'altText': 'A silver dollar sized stamp in black ink. Circle with the date and location inside.', 'title': 'Barataria Preserve Passport Stamp', 'caption': '', 'url': 'https://www.nps.gov/common/uploads/passport_stamps/FB67BF83-93C1-0972-9223670918D28875.jpg'}], 'geometryPoiId': '528CDA78-DAB1-4042-B034-238141EA5DC5', 'amenities': ['Accessible Rooms', 'Assistive Listening Systems', 'Automated Entrance', 'Automated External Defibrillator (AED)', 'Baby Changing Station', 'Benches/Seating', 'Bicycle - Rack', 'Canoe/Kayak/Small Boat Launch', 'Captioned Media', 'Cellular Signal', 'Fire Extinguisher', 'First Aid Kit Available', 'Historical/Interpretive Information/Exhibits', 'Information', 'Information - Maps Available', 'Information - Ranger/Staff Member Present', 'Information Kiosk/Bulletin Board', 'Parking - Auto', 'Parking - Boat Trailer', 'Parking - Bus/RV', 'Permits Issued', 'Picnic Table', 'Restroom', 'Restroom - Accessible', 'Restroom - Family', 'Scenic View/Photo Spot', 'Theater/Auditorium', 'Toilet - Flush', 'Trailhead', 'Trash/Litter Receptacles', 'Water - Bottle-Filling Station', 'Water - Drinking/Potable', 'Wheelchair Accessible', 'Wheelchairs Available'], 'contacts': {'phoneNumbers': [{'phoneNumber': '5046893690', 'description': '', 'extension': '10', 'type': 'Voice'}, {'phoneNumber': '5046897897', 'description': '', 'extension': '', 'type': 'Fax'}], 'emailAddresses': [{'description': '', 'emailAddress': 'jela_interpretation@nps.gov'}]}, 'directionsInfo': 'The Barataria Preserve is located 17 miles south of New Orleans on the west bank of the Mississippi River; Barataria Blvd./Highway 45 runs through the preserve. Note that not all GPS systems find the preserve successfully, so double check your GPS against a map. The Visitor Center is located just off of Highway 45.', 'directionsUrl': 'http://www.nps.gov/jela/planyourvisit/maps.htm', 'operatingHours': [{'exceptions': [{'exceptionHours': {'wednesday': 'Closed', 'monday': 'Closed', 'thursday': 'Closed', 'sunday': 'Closed', 'tuesday': 'Closed', 'friday': 'Closed', 'saturday': 'Closed'}, 'startDate': '2024-07-04', 'name': 'Independence Day', 'endDate': '2024-07-04'}, {'exceptionHours': {'monday': 'Closed'}, 'startDate': '2024-09-02', 'name': 'Labor Day', 'endDate': '2024-09-02'}, {'exceptionHours': {}, 'startDate': '2024-11-11', 'name': 'Veterans Day', 'endDate': '2024-11-11'}], 'description': 'The Barataria Preserve Visitor Center is open year-round; the visitor center is closed on federal holidays. While our visitor center is closed on Mondays and Tuesdays, our trails are open seven days a week.

Parking lots at Visitor Center, Bayou Coquille and Pecan Grove are open every day 9:00 am-5:00 pm all year round, including federal holidays.

Closures for Mardi Gras are determined annually based on site accessibility and safety for visitors and employees. Announcements will be posted accordingly.', 'standardHours': {'wednesday': '9:30AM - 4:30PM', 'monday': 'Closed', 'thursday': '9:30AM - 4:30PM', 'sunday': '9:30AM - 4:30PM', 'tuesday': 'Closed', 'friday': '9:30AM - 4:30PM', 'saturday': '9:30AM - 4:30PM'}, 'name': 'Barataria Preserve'}], 'addresses': [{'postalCode': '70072', 'city': 'Marrero', 'stateCode': 'LA', 'countryCode': 'US', 'provinceTerritoryCode': '', 'line1': '6588 Barataria Blvd.', 'type': 'Physical', 'line3': '', 'line2': ''}, {'postalCode': '70072', 'city': 'Marrero', 'stateCode': 'LA', 'countryCode': 'US', 'provinceTerritoryCode': '', 'line1': '6588 Barataria Blvd.', 'type': 'Mailing', 'line3': '', 'line2': ''}], 'images': [{'credit': 'NPS', 'crops': [], 'title': 'The Barataria Preserve Visitor Center', 'altText': 'A grey building with a dark sloped roof. The front has clear glass doors and a sign identifying it.', 'caption': 'The Visitor Center at Barataria Preserve provides exhibits, ranger talks, and information.', 'url': 'https://www.nps.gov/common/uploads/structured_data/FB1B892F-B120-F212-F3365E9299950D0C.jpg'}, {'credit': 'NPS', 'crops': [], 'title': 'Area Map Inside the Visitor Center', 'altText': 'A large, mostly green satellite map on a wall. Areas colored orange to show land change.', 'caption': 'A map of the Lower Mississippi River Delta shows current and expected land change', 'url': 'https://www.nps.gov/common/uploads/structured_data/FB4768FE-0D4E-898D-6F38A8F8B4F4EECA.jpg'}, {'credit': 'NPS', 'crops': [], 'title': 'Animal Exhibit Inside Visitor Center', 'altText': 'Indoor diorama featuring a taxidermy brown deer and blue heron bird standing in grass.', 'caption': 'An exhibit inside the visitor center talks about animal life at the preserve.', 'url': 'https://www.nps.gov/common/uploads/structured_data/FB4C9826-A045-B766-0144707033F32276.jpg'}, {'credit': 'NPS', 'crops': [], 'title': 'Forest Exhibit inside Visitor Center', 'altText': 'A diorama features six tree trunks that reach to the ceiling. Palm and moss vegetation around them.', 'caption': "An exhibit on the preserve's forest ecosystem", 'url': 'https://www.nps.gov/common/uploads/structured_data/FB542291-B084-6D8F-2A9C0AF52DB86169.jpg'}, {'credit': 'NPS', 'crops': [], 'title': 'Looking Down the Visitor Center Trail', 'altText': 'A wooden boardwalk extends forward with railings and vegetation growing all around.', 'caption': 'The beginning of the Visitor Center Trail at Barataria', 'url': 'https://www.nps.gov/common/uploads/structured_data/FB59DE20-05FB-F432-1374F7F89EDC25D5.jpg'}], 'multimedia': [], 'relevanceScore': 1.0, 'lastIndexedDate': ''}

{'id': 'EC2F137C-9E73-48DA-A350-3EC954E6454E', 'url': 'https://www.nps.gov/pore/planyourvisit/visitorcenters.htm#bearvalleyvc', 'name': 'Bear Valley Visitor Center', 'parkCode': 'pore', 'description': "The park's primary visitor center provides an orientation of the park's roads, trails, and human and natural history. The interior exhibit space provides a glimpse of the diverse ecosystems and cultural heritage of the park. Audio-visual programs, shown in the auditorium, are available upon request. Natural history books, cards, and posters are for sale in the bookstore. Beach fire permits may be obtained here.", 'latitude': '38.041122138', 'longitude': '-122.800335703', 'latLong': '{lat:38.041122138, lng:-122.800335703}', 'audioDescription': "The Bear Valley Visitor Center is located in a fairly flat meadow at the base of a wooded ridge that rises to the west. Some of the western part of the meadow serves as a fenced horse pasture. The Bear Valley Visitor Center was constructed to resemble a large barn and is painted gray. Inside the visitor center are a bookstore, an information desk, an auditorium, and museum exhibits. On the right just before one passes through the visitor center's front double doors is a hallway leading to the restrooms. As one enters the visitor center, the bookstore is immediately to one's left, the information desk ahead and to the left, the entrance to the auditorium immediately beyond the information desk, and the museum exhibits to the right. The museum exhibits contain taxidermied animals and exhibits about the park's major ecosystems, including coastal wetlands, coastal shorelines, coastal grasslands, forests, and open ocean. There are also exhibits about human history at Point Reyes.", 'isPassportStampLocation': '1', 'passportStampLocationDescription': 'The Point Reyes National Seashore Passport Stamp may be found inside the Bear Valley Visitor Center at the information desk. Check operating hours to know when to arrive so that the visitor center will be open.', 'passportStampImages': [{'credit': '', 'description': '', 'crops': [{'aspectRatio': 1.0, 'url': 'https://www.nps.gov/common/uploads/passport_stamps/primary/5E1389FA-FA1A-B364-D71B52BA8D3FBED5.gif'}], 'altText': 'A green circle surrounds the words "Point Reyes National Seashore. Point Reyes Station, CA."', 'title': "Pt. Reyes Nat'l Seashore Passport Stamp", 'caption': '', 'url': 'https://www.nps.gov/common/uploads/passport_stamps/5E1389FA-FA1A-B364-D71B52BA8D3FBED5.gif'}, {'credit': '', 'description': '', 'crops': [{'aspectRatio': 1.0, 'url': 'https://www.nps.gov/common/uploads/passport_stamps/primary/44960F36-FF14-0BC7-0EEFEA4254BEEF61.gif'}], 'altText': 'The words Point Reyes Lighthouse arch around a dark green line drawing of a short lighthouse.', 'title': 'Point Reyes Lighthouse USLHS Stamp', 'caption': '', 'url': 'https://www.nps.gov/common/uploads/passport_stamps/44960F36-FF14-0BC7-0EEFEA4254BEEF61.gif'}, {'credit': '', 'description': '', 'crops': [{'aspectRatio': 1.0, 'url': 'https://www.nps.gov/common/uploads/passport_stamps/primary/4478E883-FFD4-81FC-F9A4B3DAD3CDB977.gif'}], 'altText': 'A passport stamp of a bull tule elk.', 'title': "CA State Park's PRNS Tule Elk Stamp", 'caption': '', 'url': 'https://www.nps.gov/common/uploads/passport_stamps/4478E883-FFD4-81FC-F9A4B3DAD3CDB977.gif'}], 'geometryPoiId': '2082A5B7-F68E-4C70-B4F1-6EE279C330EF', 'amenities': ['Automated External Defibrillator (AED)', 'Bicycle - Rack', 'Bus/Shuttle Stop', 'Fire Extinguisher', 'First Aid Kit Available', 'First Aid/Medical Care Available', 'Food/Drink - Snacks', 'Gifts/Souvenirs/Books', 'Historical/Interpretive Information/Exhibits', 'Information', 'Information - Maps Available', 'Information - Ranger/Staff Member Present', 'Information Kiosk/Bulletin Board', 'Internet/WiFi Available', 'Parking - Auto', 'Parking - Bus/RV', 'Permits Issued', 'Picnic Table', 'Public Transit', 'Recycling', 'Restroom', 'Restroom - Accessible', 'Theater/Auditorium', 'Toilet - Flush', 'Trailhead', 'Trash/Litter Receptacles', 'Water - Bottle-Filling Station', 'Water - Drinking/Potable'], 'contacts': {'phoneNumbers': [{'phoneNumber': '4154645100', 'description': '', 'extension': '', 'type': 'Voice'}], 'emailAddresses': [{'description': 'Please browse through our website (the Plan Your Visit section is very useful) and check out the Frequently Asked Questions before submitting your message. We receive a lot of emails requesting information that is available through our website. 

We will respond to emails in the order they are received as soon as possible. Due to the high volume of email, response to your message may take more than a week. Please ensure that the email address you provide is correct.', 'emailAddress': 'pore_info@nps.gov'}]}, 'directionsInfo': 'The Bear Valley Visitor Center is located approximately 30 miles (50 km) north of San Francisco, less than 1 mile off of Highway 1 along Bear Valley Road. Travelers may approach the park via the winding scenic Highway 1, either from the north or the south. Visitors can also reach the park via Sir Francis Drake Boulevard or the Point Reyes/Petaluma Road.', 'directionsUrl': 'https://www.nps.gov/pore/planyourvisit/directions.htm', 'operatingHours': [{'exceptions': [{'exceptionHours': {'wednesday': '9:30AM - 5:00PM', 'monday': '9:30AM - 5:00PM', 'thursday': '9:30AM - 2:00PM', 'sunday': '9:30AM - 5:00PM', 'tuesday': '9:30AM - 5:00PM', 'friday': '9:30AM - 5:00PM', 'saturday': '9:30AM - 5:00PM'}, 'startDate': '2024-11-28', 'name': 'Thanksgiving Day', 'endDate': '2024-11-28'}, {'exceptionHours': {'wednesday': 'Closed', 'monday': 'Closed', 'thursday': 'Closed', 'sunday': 'Closed', 'tuesday': 'Closed', 'friday': 'Closed', 'saturday': 'Closed'}, 'startDate': '2024-12-25', 'name': 'Christmas Day', 'endDate': '2024-12-25'}], 'description': 'Until further notice, the Bear Valley Visitor Center is scheduled to be open daily from 9:30 am until 5 pm.

The Bear Valley Visitor Center is closed on December 25 and may close at 2 pm on Thanksgiving and Christmas Eve.', 'standardHours': {'wednesday': '9:30AM - 5:00PM', 'monday': '9:30AM - 5:00PM', 'thursday': '9:30AM - 5:00PM', 'sunday': '9:30AM - 5:00PM', 'tuesday': '9:30AM - 5:00PM', 'friday': '9:30AM - 5:00PM', 'saturday': '9:30AM - 5:00PM'}, 'name': 'Bear Valley Visitor Center'}], 'addresses': [{'postalCode': '94956', 'city': 'Point Reyes Station', 'stateCode': 'CA', 'countryCode': 'US', 'provinceTerritoryCode': '', 'line1': 'Bear Valley Visitor Center', 'type': 'Physical', 'line3': '', 'line2': '1 Bear Valley Road'}, {'postalCode': '94956', 'city': 'Point Reyes Station', 'stateCode': 'CA', 'countryCode': 'US', 'provinceTerritoryCode': '', 'line1': 'Bear Valley Visitor Center', 'type': 'Mailing', 'line3': '', 'line2': '1 Bear Valley Road'}], 'images': [{'credit': 'NPS Photo / A. Kopshever', 'crops': [], 'title': 'Bear Valley Visitor Center: Elephant Seal Model', 'altText': 'A full-size model of a bull elephant seal in a museum setting.', 'caption': 'One of the first things visitors notice upon entering the Bear Valley Visitor Center is a full-size model of a bull elephant seal.', 'url': 'https://www.nps.gov/common/uploads/structured_data/545866B9-A991-8C44-D9171C6F07313633.jpg'}, {'credit': 'NPS Photo', 'crops': [], 'title': 'Bear Valley Visitor Center - April 15, 2017', 'altText': 'A visitor center with the appearance of a large gray barn in a grassy field.', 'caption': 'The Bear Valley Visitor Center', 'url': 'https://www.nps.gov/common/uploads/structured_data/D0012857-FA30-1E1F-552DD349BAA54C7A.jpg'}, {'credit': 'NPS Photo / A. Kopshever', 'crops': [], 'title': 'Bear Valley Visitor Center Exhibits', 'altText': 'Museum exhibits with artifacts, photos, and information about the human history of Point Reyes.', 'caption': 'Learn about the thousands of years of human history at Point Reyes.', 'url': 'https://www.nps.gov/common/uploads/structured_data/54634EE9-D0D9-5FA0-DAF41394A9B48BB0.jpg'}, {'credit': 'NPS Photo / A. Kopshever', 'crops': [], 'title': 'Bear Valley Visitor Center Information Desk', 'altText': 'A female ranger awards a junior seashore ranger patch to two kids.', 'caption': 'Rangers and volunteers are available at the information desk with maps, information and junior ranger badges!', 'url': 'https://www.nps.gov/common/uploads/structured_data/547BE53C-C1C6-2B97-4E6E7BA4B828D2EE.jpg'}], 'multimedia': [], 'relevanceScore': 1.0, 'lastIndexedDate': ''}

{'id': '6BF5B826-9CDA-4975-9893-1818FB6749ED', 'url': 'https://www.nps.gov/gaar/planyourvisit/bettles.htm', 'name': 'Bettles Ranger Station and Visitor Center', 'parkCode': 'gaar', 'description': 'The Bettles Ranger Station is situated outside of the boundaries of Gates of the Arctic National Park & Preserve, in Bettles, Alaska. This small ranger station and visitor center has exhibits, park-related films, interpretive programs, and trip-planning tools.', 'latitude': '66.91921', 'longitude': '-151.514073', 'latLong': '{lat:66.91921, lng:-151.514073}', 'audioDescription': '', 'isPassportStampLocation': '1', 'passportStampLocationDescription': 'Gates of the Arctic National Park and Preserve -- Bettles, AK', 'passportStampImages': [{'credit': '', 'description': '', 'crops': [{'aspectRatio': 1.0, 'url': 'https://www.nps.gov/common/uploads/passport_stamps/primary/214F3DBB-CA12-AD34-00FBF12867AD6C56.jpg'}], 'altText': 'Gates of the Arctic Passport Stamp', 'title': 'GAAR Passport Stamp Bettles', 'caption': '', 'url': 'https://www.nps.gov/common/uploads/passport_stamps/214F3DBB-CA12-AD34-00FBF12867AD6C56.jpg'}], 'geometryPoiId': '', 'amenities': ['Historical/Interpretive Information/Exhibits', 'Information', 'Information - Maps Available', 'Information - Ranger/Staff Member Present', 'Information Kiosk/Bulletin Board'], 'contacts': {'phoneNumbers': [{'phoneNumber': '9076925494', 'description': '', 'extension': '', 'type': 'Voice'}], 'emailAddresses': [{'description': '', 'emailAddress': 'fair_information@nps.gov'}]}, 'directionsInfo': 'Across Airport Road from the Bettles airport', 'directionsUrl': '', 'operatingHours': [{'exceptions': [{'exceptionHours': {}, 'startDate': '2023-09-26', 'name': 'Winter Hours', 'endDate': '2024-05-31'}], 'description': 'Closed in winter.

**Summer 2023** Ranger Station and Visitor Center is closed until further notice. For visitor assistance, contact the Fairbanks Alaska Public Lands Information Center. 

Backcountry orientations and Bear Resistant Food Containers (BRFCs) are not available at this location until further notice.', 'standardHours': {'wednesday': 'Closed', 'monday': 'Closed', 'thursday': 'Closed', 'sunday': 'Closed', 'tuesday': 'Closed', 'friday': 'Closed', 'saturday': 'Closed'}, 'name': 'Bettles Ranger Station and Visitor Center'}], 'addresses': [{'postalCode': '99726', 'city': 'Bettles', 'stateCode': 'AK', 'countryCode': 'US', 'provinceTerritoryCode': '', 'line1': 'Airport Rd', 'type': 'Physical', 'line3': '', 'line2': ''}, {'postalCode': '99726', 'city': 'Bettles', 'stateCode': 'AK', 'countryCode': 'US', 'provinceTerritoryCode': '', 'line1': 'PO Box 30', 'type': 'Mailing', 'line3': '', 'line2': ''}], 'images': [{'credit': 'NPS Photo / Claire Dal Nogare', 'crops': [], 'title': 'Bettles Visitor Center', 'altText': 'View of blue wooden A-frame building', 'caption': 'Bettles Ranger Station in the Summer', 'url': 'https://www.nps.gov/common/uploads/structured_data/87F69EEA-0A9E-16D7-B6B2040F0C9688F1.jpg'}, {'credit': 'NPS Photo / Claire Dal Nogare', 'crops': [], 'title': 'Interior of Bettles Ranger Station', 'altText': 'Interior Room of Bettles Ranger Station with a wooden table and mount of a white wolf with ptarmigan', 'caption': 'The interior of the Bettles Ranger Station has information and exhibits about the park and its wildlife.', 'url': 'https://www.nps.gov/common/uploads/structured_data/881185EF-FD0A-8878-A87A69936700B1A5.jpg'}, {'credit': 'NPS Photo / Claire Dal Nogare', 'crops': [], 'title': 'Bettles Map Exhibit', 'altText': 'large wall map shows the geography and topography of Gates of the Arctic National Park', 'caption': 'Bettles Ranger Station has various exhibits, including a large topographic map of the park.', 'url': 'https://www.nps.gov/common/uploads/structured_data/DD732BB0-CF33-6BC7-30D1434F6E99178E.jpg'}, {'credit': 'NPS Photo', 'crops': [], 'title': 'Bettles Ranger Station', 'altText': 'View of blue wooden A-frame building in the snow with a snowmobile in front', 'caption': 'Bettles Ranger Station in the winter.', 'url': 'https://www.nps.gov/common/uploads/structured_data/199751BE-B09A-6581-9519535B3CBF4CAD.jpg'}], 'multimedia': [], 'relevanceScore': 1.0, 'lastIndexedDate': ''}

{'id': '3789F7AB-B6E7-4FD7-BD03-33F47F81B387', 'url': 'https://www.nps.gov/jela/planyourvisit/chalmette-battlefield.htm', 'name': 'Chalmette Battlefield and Chalmette National Cemetery', 'parkCode': 'jela', 'description': "Site of the Battle of New Orleans in 1815, Chalmette Battlefield contains a reconstructed American rampart, an 1830s house, 100-foot-high Chalmette Monument, and outdoor exhibits for self-guided tours. Visitor center films and exhibits share the battle and the site's later history. Ranger talks offered daily. Chalmette National Cemetery was established during the Civil War and holds more than 14,000 graves of Americans from the War of 1812 to the Vietnam War; audio tour available. Free.", 'latitude': '29.94213464896627', 'longitude': '-89.99435227703322', 'latLong': '{lat:29.94213464896627, lng:-89.99435227703322}', 'audioDescription': "Traveling from New Orleans 6 miles west on St. Bernard Hwy. (LA 46) turn right on Battlefield Rd. and drive through the main gates. Welcome to Chalmette Battlefield and National Cemetery of Jean Lafitte National Historical Park and Preserve. The Chalmette Visitor Center is located less than a mile ahead as you travel south toward the Mississippi River. Observe the 20 mph speed and directional signs as you pass the National Monument to the visitor center parking lot. Restroom facilities are located nearby in the smaller of the two buildings. The Visitor Center is on opposite side of the parking lot and both buildings are less than 100 feet apart. The visitor center is a light beige with green trim, metal roofed, rectangular shaped approximately 200' x 100' building. Two green automatic entrance doors face the center of both the south and north entrances of the visitor center. Climbing a couple of handrail steps a push button is on the right column for auto operation of the entrance doors or they can be manually pulled opened. Walkways are handicap accessible and make elevated 90 degree turns to the entrance doors of the visitor center. Once inside the visitor center, you are greeted at the ranger desk, and just beyond is a museum with exhibits and films for your enjoyment.", 'isPassportStampLocation': '1', 'passportStampLocationDescription': 'The Chalmette Cancellation Stamp is your personal record of visit to the Chalmette Battlefield and National Cemetery which offers living history programs, ranger talks, and visitor center exhibits and films. It is the site of the 1815 Battle of New Orleans. The stamp is available at the ranger desk in the visitor center.', 'passportStampImages': [{'credit': '', 'description': '', 'crops': [{'aspectRatio': 1.0, 'url': 'https://www.nps.gov/common/uploads/passport_stamps/primary/9B52FF93-B18F-2E1C-FBC8248E86E947A5.jpg'}], 'altText': 'A silver dollar sized stamp in black ink. A hollow circle with the park name, date, and location.', 'title': 'Chalmette Cancellation Stamp', 'caption': '', 'url': 'https://www.nps.gov/common/uploads/passport_stamps/9B52FF93-B18F-2E1C-FBC8248E86E947A5.jpg'}], 'geometryPoiId': '09152813-BD05-45BC-8BD6-3B5461FBA4F0', 'amenities': ['Automated Entrance', 'Automated External Defibrillator (AED)', 'Baby Changing Station', 'Benches/Seating', 'Bicycle - Rack', 'Cellular Signal', 'Fire Extinguisher', 'First Aid Kit Available', 'Gifts/Souvenirs/Books', 'Information', 'Information - Maps Available', 'Information - Ranger/Staff Member Present', 'Information Kiosk/Bulletin Board', 'Parking - Auto', 'Picnic Table', 'Restroom', 'Restroom - Accessible', 'Toilet - Flush', 'Trash/Litter Receptacles', 'Water - Bottle-Filling Station', 'Water - Drinking/Potable', 'Wheelchair Accessible'], 'contacts': {'phoneNumbers': [{'phoneNumber': '5042810510', 'description': '', 'extension': '', 'type': 'Voice'}, {'phoneNumber': '5042810512', 'description': '', 'extension': '', 'type': 'Fax'}], 'emailAddresses': [{'description': '', 'emailAddress': 'jela_interpretation@nps.gov'}]}, 'directionsInfo': 'Chalmette Battlefield & Chalmette National Cemetery are 7 miles downriver from New Orleans and located next to each other. They are south of I-10 near Paris Road (Interstate 510/Highway 47). Note: St. Bernard Highway/Highway 46 in Chalmette is the same street as St. Claude Avenue in New Orleans. GPS Users: To reach the battlefield visitor center, use One Battlefield Road. 8606 West St. Bernard Highway is the battlefield/national cemetery mailing address and GPS will provide directions to the cemetery.', 'directionsUrl': 'http://www.nps.gov/jela/planyourvisit/maps.htm', 'operatingHours': [{'exceptions': [{'exceptionHours': {'wednesday': 'Closed', 'monday': 'Closed', 'thursday': 'Closed', 'sunday': 'Closed', 'tuesday': 'Closed', 'friday': 'Closed', 'saturday': 'Closed'}, 'startDate': '2025-01-20', 'name': 'Martin Luther King Jr. Day', 'endDate': '2025-01-20'}, {'exceptionHours': {'wednesday': 'Closed', 'monday': 'Closed', 'thursday': 'Closed', 'sunday': 'Closed', 'tuesday': 'Closed', 'friday': 'Closed', 'saturday': 'Closed'}, 'startDate': '2024-02-13', 'name': 'Mardi Gras', 'endDate': '2024-02-13'}, {'exceptionHours': {'wednesday': 'Closed', 'monday': 'Closed', 'thursday': 'Closed', 'sunday': 'Closed', 'tuesday': 'Closed', 'friday': 'Closed', 'saturday': 'Closed'}, 'startDate': '2024-02-19', 'name': "Holiday Closures - Washington's Birthday", 'endDate': '2024-02-19'}, {'exceptionHours': {'wednesday': 'Closed', 'monday': 'Closed', 'thursday': 'Closed', 'sunday': 'Closed', 'tuesday': 'Closed', 'friday': 'Closed', 'saturday': 'Closed'}, 'startDate': '2024-02-19', 'name': "President's Day", 'endDate': '2024-02-19'}, {'exceptionHours': {'wednesday': 'Closed', 'monday': 'Closed', 'thursday': 'Closed', 'sunday': 'Closed', 'tuesday': 'Closed', 'friday': 'Closed', 'saturday': 'Closed'}, 'startDate': '2024-02-19', 'name': "Washington's Birthday", 'endDate': '2024-02-19'}, {'exceptionHours': {'wednesday': 'Closed', 'monday': 'Closed', 'thursday': 'Closed', 'sunday': 'Closed', 'tuesday': 'Closed', 'friday': 'Closed', 'satur