{'id': '05D66EBD-460D-4843-9C79-76067E3E5E88', 'url': '', 'name': "General Grant's Headquarters at City Point", 'parkCode': 'pete', 'description': "Station is located in the former plantation home of the Eppes Family. When open, visitors can view a 15 minute video and tour the first floor of the home including a room with interpretive exhibits and two rooms with original 18th and 19th century furniture that belonged to the Eppes Family. Exhibits focus on the Union Army's occupation of City Point, as well as the lives of the free and enslaved people who lived on the plantation before the war. See closures listed.", 'latitude': '37.3168047393', 'longitude': '-77.2775101662', 'latLong': '{lat:37.3168047393, lng:-77.2775101662}', 'audioDescription': '', 'isPassportStampLocation': '1', 'passportStampLocationDescription': 'Rubber date stamp with the text "City Point" and "Petersburg National Battlefield". When the visitor contact station is closed the passport stamp for Grant's Headquarters can be found in the Eastern Front Visitor Center.', 'passportStampImages': [{'credit': '', 'description': '', 'crops': [{'aspectRatio': 1.0, 'url': 'https://www.nps.gov/common/uploads/passport_stamps/primary/171CE49D-ECFF-15CF-45D32A32C417E336.jpg'}], 'altText': "stamp with text Petersburg NB, Grant's Headquarters at City Point, Jan 02 2022", 'title': "Grant's Headquarters at City Point", 'caption': '', 'url': 'https://www.nps.gov/common/uploads/passport_stamps/171CE49D-ECFF-15CF-45D32A32C417E336.jpg'}], 'geometryPoiId': '', 'amenities': ['Accessible Sites', 'Baby Changing Station', 'Dock/Pier', 'First Aid Kit Available', 'Gifts/Souvenirs/Books', 'Historical/Interpretive Information/Exhibits', 'Information', 'Information - Maps Available', 'Parking - Auto', 'Parking - Bus/RV', 'Restroom', 'Restroom - Accessible'], 'contacts': {'phoneNumbers': [{'phoneNumber': '8047323531203', 'description': '', 'extension': '', 'type': 'Voice'}], 'emailAddresses': [{'description': 'Division of Interpre