{'id': 'BBCF6F5B-9FC7-44D3-96A7-35D070CD96BC', 'url': '', 'name': 'Golden Spike National Historical Park Visitor Center', 'parkCode': 'gosp', 'description': "The Visitor Center is the first place to stop for any visitors coming out to the park. The center features the WNPA Park Store, exhibits, a theater, picnic areas, and a welcoming staff that will help visitors get the most out of their visit. Spring-Summer: The visitor center is open daily, 9:00 AM - 5:00 PM MDT. Fall-Winter: Mid-October to mid-April the visitor center is open Thursday-Monday 9:00 AM - 5:00 PM MST (excluding Thanksgiving, Christmas Eve, Christmas, and New Year's).", 'latitude': '41.617470505', 'longitude': '-112.550877226', 'latLong': '{lat:41.617470505, lng:-112.550877226}', 'audioDescription': "The Visitor Center is the first place to stop for any visitors coming out to the park. The center features the WNPA Park Store, exhibits, a theater, picnic areas & a welcoming staff that will help visitors get the most out of their visit. Spring-Summer: The visitor center is open daily, 9:00 AM - 5:00 PM MDT Fall-Winter: Mid-October to mid-April the visitor center is open Thursday-Monday 9:00 AM - 5:00 PM MST (excluding Thanksgiving, Christmas Eve, Christmas, and New Year's).", 'isPassportStampLocation': '1', 'passportStampLocationDescription': "Golden Spike National Historical Park participates in the NPS Passport program. The passport stamp is located inside the Visitor Center, unless noted otherwise on the park's Current Conditions page.", 'passportStampImages': [{'credit': '', 'description': '', 'crops': [{'aspectRatio': 1.0, 'url': 'https://www.nps.gov/common/uploads/passport_stamps/primary/CB73D958-FE9C-6283-B4B2B748B852EBC5.jpg'}], 'altText': 'Passport Stamp', 'title': 'Golden Spike NHP Passport Stamp', 'caption': '', 'url': 'https://www.nps.gov/common/uploads/passport_stamps/CB73D958-FE9C-6283-B4B2B748B852EBC5.jpg'}, {'credit': '', 'description': '', 'crops': [{'aspectRatio': 1.0, 'url': 'https: