{'id': '4D305775-CCEE-4F1A-9D91-DA1888FD1A68', 'url': 'https://www.nps.gov/knri/learn/historyculture/index.htm', 'name': 'Knife River Indian Villages National Historic Site Visitor Center', 'parkCode': 'knri', 'description': 'The Visitor Center is located off Highway 37 just north of the city of Stanton, ND. The Visitor Center’s entrance is in the shape of a giant eagle welcoming visitors. Once inside, visitors can view the movie, tour the exhibits or shop in our bookstore. Outside and behind the Visitor Center is a reconstructed earthlodge (furnished with replica artifacts in the summer) and the beginning of one of the three trails located at the park.', 'latitude': '47.35048', 'longitude': '-101.37187', 'latLong': '{lat:47.35048, lng:-101.37187}', 'audioDescription': 'The visitor center is a one story building approximately 50 feet wide and 50 feet length. It has a light brown stucco exterior. To the right of the front entrance door, there is a large architectural feature resembling an eagle. Immediately to the right when entering the front entrance doors is a hallway containing bathrooms. Six feet further, you will enter into the lobby proper of the building. The lobby area has a circular shape and is loosely based on the interior of a historical earthlodge. These features include four structural posts and the center floor space has a circular feature of inlaid stonework representing a firepit. The south wall of the lobby has gift items and books for sale. The east wall has a reception desk staffed by uniformed personnel. To the left of the reception desk is a door entering into a small vestibule. Turning to the left of this are doors that exit the facility towards the earthlodge and trail system. The north wall of the lobby has a large set of windows with a seating area below them. The west wall has an entrance to the museum and theater. The museum area has numerous wall panels of text and small artifact cases. Three cases contain many Native American artifacts. The theater shows a thirteen minute film featuring the cultural history of the Hidatsa tribe through the perspective of a woman known as Buffalo Bird Woman. The theater seats up to thirty people and the film is shown upon visitor request.', 'isPassportStampLocation': '1', 'passportStampLocationDescription': 'Two cancellation stamps are available. One specific to the park and one for the Lewis & Clark National Historic Trail', 'passportStampImages': [{'credit': '', 'description': '', 'crops': [{'aspectRatio': 1.0, 'url': 'https://www.nps.gov/common/uploads/passport_stamps/primary/D359EEF2-D946-4863-1590DAF5B498DA5D.jpg'}], 'altText': 'ink stamp', 'title': 'KNRI stamp', 'caption': '', 'url': 'https://www.nps.gov/common/uploads/passport_stamps/D359EEF2-D946-4863-1590DAF5B498DA5D.jpg'}, {'credit': '', 'description': '', 'crops': [{'aspectRatio': 1.0, 'url': 'https://www.nps.gov/common/uploads/passport_stamps/primary/D36CEEE0-CBE9-7A40-530D1D0418CEADD0.jpg'}], 'altText': 'ink stamp', 'title': 'LECL Stamp', 'caption': '', 'url': 'https://www.nps.gov/common/uploads/passport_stamps/D36CEEE0-CBE9-7A40-530D1D0418CEADD0.jpg'}], 'geometryPoiId': '', 'amenities': ['Benches/Seating', 'Bicycle - Rack', 'Gifts/Souvenirs/Books', 'Historical/Interpretive Information/Exhibits', 'Information - Ranger/Staff Member Present', 'Parking - Auto', 'Parking - Bus/RV', 'Picnic Shelter/Pavilion', 'Restroom', 'Restroom - Accessible', 'Theater/Auditorium', 'Trailhead'], 'contacts': {'phoneNumbers': [{'phoneNumber': '701-745-3300', 'description': '', 'extension': '', 'type': 'Voice'}, {'phoneNumber': '701-745-3708', 'description': '', 'extension': '', 'type': 'Fax'}], 'emailAddresses': [{'description': '', 'emailAddress': 'knri_information@nps.gov'}]}, 'directionsInfo': 'One-half mile north of Stanton, ND on County Road 37. One hour northwest of Bismarck, ND and one and a half hours southwest of Minot, ND.', 'directionsUrl': 'https://www.nps.gov/knri/planyourvisit/maps.htm', 'operatingHours': [{'exceptions': [{'exceptionHours': {'wednesday': 'Closed', 'monday': 'Closed', 'thursday': 'Closed', 'sunday': 'Closed', 'tuesday': 'Closed', 'friday': 'Closed', 'saturday': 'Closed'}, 'startDate': '2025-01-01', 'name': "Visitor Center closed on New Year's Day", 'endDate': '2025-01-01'}, {'exceptionHours': {'wednesday': '8:00AM - 4:30PM', 'monday': '8:00AM - 4:30PM', 'thursday': '8:00AM - 4:30PM', 'sunday': '8:00AM - 4:30PM', 'tuesday': '8:00AM - 4:30PM', 'friday': '8:00AM - 4:30PM', 'saturday': '8:00AM - 4:30PM'}, 'startDate': '2023-09-02', 'name': 'Winter Hours', 'endDate': '2024-05-27'}, {'exceptionHours': {'wednesday': 'Closed', 'monday': 'Closed', 'thursday': 'Closed', 'sunday': 'Closed', 'tuesday': 'Closed', 'friday': 'Closed', 'saturday': 'Closed'}, 'startDate': '2024-11-28', 'name': 'Visitor Center closed on Thanksgiving Day', 'endDate': '2024-11-28'}, {'exceptionHours': {'wednesday': 'Closed', 'monday': 'Closed', 'thursday': 'Closed', 'sunday': 'Closed', 'tuesday': 'Closed', 'friday': 'Closed', 'saturday': 'Closed'}, 'startDate': '2024-12-25', 'name': 'Visitor Center closed on Christmas Day', 'endDate': '2024-12-25'}], 'description': 'Knife River Indian Villages NHS is open year-round. Park trails and grounds are open daily from sunrise to sunset. Dogs are welcome on the trails as long they are on a leash.

