{'id': '3AC45A0A-B853-450C-8F76-B12255DA6CE8', 'url': 'https://www.nps.gov/libo/planyourvisit/visitorcenters.htm', 'name': 'Memorial Visitor Center', 'parkCode': 'libo', 'description': 'The Memorial Visitor Center is closed from 12:00 to 1:00 pm. The Memorial Visitor Center, completed in 1943, was designed with two memorial halls and a connecting cloister. The Memorial Court features five sculptured panels, the work or E.H. Daniels, marking significant periods in the life of Abraham Lincoln. Museum artifacts and exhibits portray the life of Abraham Lincoln. Learn about his family, boyhood, and frontier life in Indiana.', 'latitude': '38.112945', 'longitude': '-86.996072', 'latLong': '{lat:38.112945, lng:-86.996072}', 'audioDescription': 'Memorial Visitor Center. 665 words. The Memorial Visitor Center is a 230-foot wide, one-story, white limestone block building with forest on both sides and back. The building consists of three equal sections. Seen from the front, the long walls of the left and right wings have five windows. Three tall, narrow windows are set side-by-side in the middle of the wall. Two small, narrow windows are near each end of the wall. The curved middle section of the building is shaped like a horseshoe and goes back 75 feet with a courtyard in front. On the walls of the curved, middle section of the building are five 15-foot by 20-foot stone sculptured panels depicting people, drawings of buildings, and text. Two glass doors and two large windows separate the panels. On the stone blocks at the top of the building, above the panels, windows, and doors reads block text carved into the limestone. A five-foot tall stone wall stands between the parking lot and the building. An opening in the wall in front of the curved middle section of the building contains four, eighty-foot long stone steps. To the right of the steps, in front of the wall, a wooden sign reads, “Memorial Visitor Center, Lincoln Boyhood National Memorial, This memorial building is Indiana’s tribute to Abraham Lincoln and his family.” From the parking lot, two parallel stone walkways, with a patch of grass in between, lead to the stone steps and the courtyard. The courtyard contains eight benches, patches of bright green mowed grass, bushes, small trees and ground cover in beds next to the building. In the courtyard, stone paths branch off to four doorways. The middle path branches into two and leads to two double glass doors. Five steps with iron handrails lead from the courtyard to the doors. The main entrance to the visitor center is through the door to the right. The door to the left is locked. The left and right branches leads to three stone steps, and heavy, light oak, wooden, double doors. There is a narrow window on each side of the wooden doors. A concrete path leads from the courtyard, across the front to the left of the building and merges with a concrete path that starts from the accessible spaces in the parking lot. The path leads to a door on the side and a door on the back of the building. The main entrance glass door from the courtyard leads to the middle of a curved hallway with a brick floor, a sandstone wall on one side, and cherry paneled wall on the other. The Information Desk is directly across from the entrance door. The bookstore is on both sides of the hallway. To the right of the Information Desk and down the curved hallway 30 feet are restrooms. The Abraham Lincoln Hall is located at the end of the hall in the right wing. Beside the Information Desk to the left is the Auditorium. To the left and down the hall 50 feet is the Lincoln In Indiana Museum. The Nancy Hanks Lincoln Hall and restroom facilities are located at the end of the hall in the left wing. Alternate entrance doors: The heavy wooden entrance door on the left of the courtyard leads to the Nancy Hanks Lincoln Hall and restrooms. The heavy wooden entrance door on the right of the courtyard leads to the Abraham Lincoln Hall. The heavy wooden door on the left side of the building leads to restrooms and the Nancy Hanks Lincoln Hall. The rear entrance has a push button on the right of the path eight feet before the glass door. This door leads to the curved hallway. To the right and down three steps is the Nancy Hanks Lincoln Hall. To the left and down the curved hallway is the museum, auditorium, information desk, bookstore and restrooms. At the end of the hallway and down three steps is the Abraham Lincoln Hall. End of description.', 'isPassportStampLocation': '1', 'passportStampLocationDescription': 'Both passport stamps are located in the Memorial Visitor Center near the front door as you enter the building. There are two stamps available, one is the location stamp which reads Lincoln City, IN, and the other reads, Living Historical Farm. The date used in the image is February 19. On February 19, 1962, President John F. Kennedy signed legislation creating Lincoln Boyhood National Memorial.', 'passportStampImages': [{'credit': '', 'description': '', 'crops': [{'aspectRatio': 1.0, 'url': 'https://www.nps.gov/common/uploads/passport_stamps/primary/2B0E2583-9860-10C5-AB790BE2FE15EC59.jpg'}], 'altText': 'Orange circle, orange text reads Lincoln Boyhood National Memorial, Lincoln City, IN, Feb 19', 'title': 'Passport Stamp ', 'caption': '', 'url': 'https://www.nps.gov/common/uploads/passport_stamps/2B0E2583-9860-10C5-AB790BE2FE15EC59.jpg'}, {'credit': '', 'description': '', 'crops': [{'aspectRatio': 1.0, 'url': 'https://www.nps.gov/common/uploads/passport_stamps/primary/2B1D5B82-AFB8-FC71-F1E05B1EAF48D3FA.jpg'}], 'altText': 'Orange circle, orange text reads Lincoln Boyhood National Memorial, Living Historical Farm, Feb 19', 'title': 'Passport Stamp, Living Historical Farm', 'caption': '', 'url': 'https://www.nps.gov/common/uploads/passport_stamps/2B1D5B82-AFB8-FC71-F1E05B1EAF48D3FA.jpg'}], 'geometryPoiId': '', 'amenities': ['Accessible Rooms', 'Accessible Sites', 'Captioned Media', 'Large Print', 'Wheelchair Accessible', 'Wheelchairs Available', 'Baby Changing Station', 'Benches/Seating', 'Bicycle - Rack', 'Cellular Signal', 'Fire Extinguisher', 'First Aid Kit Available', 'First Aid/Medical Care Available', 'Gifts/Souvenirs/Books', 'Historical/Interpretive Information/Exhibits', 'Information', 'Information - Ranger/Staff Member Present', 'Information - Maps Available', 'Recycling', 'Restroom', 'Theater/Auditorium', 'Toilet - Flush', 'Water - Drinking/Potable', 'Water - Bottle-Filling Station'], 'contacts': {'phoneNumbers': [{'phoneNumber': '8129374541', 'description': '', 'extension': '', 'type': 'Voice'}, {'phoneNumber': '8129379929', 'description': '', 'extension': '', 'type': 'Fax'}], 'emailAddresses': [{'description': '', 'emailAddress': 'libo_superintendent@nps.gov'}]}, 'directionsInfo': 'From Interstate 64, exit on US 231, (exit 57A). Travel south on US 231 to Indiana Highway 162 (about 6 miles). Take the Santa Claus/Gentryville exit. Turn west (right) on Indiana Highway 162; go 1-1/2 miles to the park entrance on the right.', 'directionsUrl': 'http://www.nps.gov/libo/planyourvisit/directions.htm', 'operatingHours': [{'exceptions': [{'exceptionHours': {'monday': 'Closed'}, 'startDate': '2025-01-20', 'name': 'Birthday of Martin Luther King Jr.', 'endDate': '2025-01-20'}, {'exceptionHours': {'wednesday': '9:00AM - 4:00PM', 'monday': '9:00AM - 4:00PM', 'thursday': '9:00AM - 4:00PM', 'sunday': '9:00AM - 4:00PM', 'tuesday': '9:00AM - 4:00PM', 'friday': '9:00AM - 4:00PM', 'saturday': '9:00AM - 4:00PM'}, 'startDate': '2024-04-01', 'name': 'Summer Hours', 'endDate': '2024-09-30'}, {'exceptionHours': {'wednesday': 'Closed', 'monday': 'Closed', 'thursday': 'Closed', 'sunday': 'Closed', 'tuesday': 'Closed', 'friday': 'Closed', 'saturday': 'Closed'}, 'startDate': '2024-10-07', 'name': 'Columbus Day', 'endDate': '2024-10-07'}, {'exceptionHours': {'wednesday': 'Closed', 'monday': 'Closed', 'thursday': 'Closed', 'sunday': 'Closed', 'tuesday': 'Closed', 'friday': 'Closed', 'saturday': 'Closed'}, 's