ick surface, stone and wood walls, book shelves with merchandise for sale.', 'caption': 'The cloister is a long hallway which connects the two Memorial Halls. The cloister has a brick floor, stone and wood walls. Park bookstore is located in the cloister. Facilities located off the cloister: restrooms, auditorium, information desk, museum.', 'url': 'https://www.nps.gov/common/uploads/structured_data/02CC7CA4-B6AF-82C3-FA9B9C3529535506.jpg'}, {'credit': 'NPS/Alexander', 'crops': [], 'title': 'Lincoln in Indiana Museum', 'altText': 'Doorway leading to room with pictures and display case. Above doorway reads "Lincoln In Indiana".', 'caption': 'The life of Abraham Lincoln in Indiana is told through pictures, graphics and displays in the park museum.', 'url': 'https://www.nps.gov/common/uploads/structured_data/621B5ECE-CC07-40E9-C979C0091E095C6F.jpg'}], 'multimedia': [], 'relevanceScore': 1.0, 'lastIndexedDate': ''}

