{'id': 'C4173AB3-274C-46A0-A76D-94AD4E8B9AEE', 'url': 'http://www.nps.gov/niob/index.htm', 'name': 'Niobrara National Scenic River Visitor Center', 'parkCode': 'niob', 'description': 'Begin your journey down the Niobrara at the visitor center, where you may discover what makes this river so special through exhibits and a twenty minute park film. Park rangers are on hand to answer questions, help you plan your trip, or give you a list of outfitters who will provide transportation and canoes, kayaks, or tubes.', 'latitude': '42.8682584735', 'longitude': '-100.5553722382', 'latLong': '{lat:42.8682584735, lng:-100.5553722382}', 'audioDescription': 'Niobrara National Scenic River Visitor Center. 575 words. The visitor center is a brown tin-sided, one-story, “L” shaped structure with a white tin roof and white gutters. The length of the building that runs South to North is approximately 40 feet long with a manual door to a small vestibule 30 feet from the southern end. The building is located on a city street and is surrounded by various residential and commercial buildings. On the wall between the south end of the building and the door large text reads “Niobrara National Scenic River Visitor Center, National Park Service.” There is also a National Park Service arrowhead to the left of the text. Above the text on the wall there are three small narrow horizontal windows, approximately 4 feet across. Ten feet to the right of the door to the vestibule is the corner of the building, and the West to East wing extends approximately 50 feet from this corner. There are five large windows spaced evenly along this wall. Sidewalks run directly along the building’s walls, and a concrete parking lot fills the space in front of the building. There is a handicap parking space directly to the left of the manual door to the vestibule, and an up-sloped ramp leads from the parking lot to the manual vestibule entrance door. The entrance vestibule is approximately 5 feet across and 7 feet deep. Straight through the vestibule is a manual door to the visitor center. The floor is tile. Inside the manual door to the interior of the visitor center, the information desk is located immediately ahead. The floor is short carpet, and the walls are white. The ceiling is approximately 14 feet high. The information desk has two lengths, one that is four feet long faces the entrance door, and the other that is four feet long and faces the open room. Beyond the ranger desk along the North wall, there is a door for employees followed by approximately 10 feet of wall displays for the Park’s Bookstore. To the right, about four feet is a locked door. To the left, there is a donation box and a park bench and two displays against the wall that runs South to North. To the right of the bench and the left of the ranger desk, the space opens into a room approximately 30 feet, East to West, by 40 feet, North to South. There are two tables in the room, one is 12 feet long with tactile display objects on it. The touch table is 8 feet from the South wall and runs West to East. There is a 5-foot-wide, round table in the middle of the room with four, wheeled chairs around it. On the western wall (the back wall when facing the information desk from the front door) approximately 12 feet beyond the information desk, is a 4-foot-wide, 20-foot-long hallway that faces west. On the right-hand wall of the hallway, two feet from its entrance, is the door to the women’s restroom. 6 feet from the entrance of the hallway on the right-hand side, there are two drinking fountains set back into a four-foot-wide alcove, and two feet beyond the alcove is the door to the men’s restroom. After the door to the Men’s Restroom, there is a locked door. Along the left wall of the hallway, approximately 7 feet from the entrance, is a door to the theater. The hallway has an emergency exit at the end. End of description.', 'isPassportStampLocation': '1', 'passportStampLocationDescription': 'There is a Passport Stamp located at the Niobrara National Scenic River Visitor Center. If we are closed, the Stamp is also located at the Fort Niobrara National Wildlife Refuge Visitor Center and Smith Falls State Park Visitor Center.', 'passportStampImages': [{'credit': '', 'description': '', 'crops': [{'aspectRatio': 1.0, 'url': 'https://www.nps.gov/common/uploads/passport_stamps/primary/942EAE55-D61A-8781-DE276748A054D1D9.jpg'}], 'altText': 'Image of the Niobrara NSR Passport Stamp on white paper. ', 'title': 'Niobrara NSR Passport Stamp', 'caption': '', 'url': 'https://www.nps.gov/common/uploads/passport_stamps/942EAE55-D61A-8781-DE276748A054D1D9.jpg'}], 'geometryPoiId': '', 'amenities': ['Accessible Rooms', 'Assistive Listening Systems', 'Audio Description', 'Automated External Defibrillator (AED)', 'Benches/Seating', 'Braille', 'Captioned Media', 'Cellular Signal', 'Fire Extinguisher', 'First Aid/Medical Care Available', 'Gifts/Souvenirs/Books', 'Historical/Interpretive Information/Exhibits', 'Information', 'Information - Maps Available', 'Information - Ranger/Staff Member Present', 'Internet/WiFi Available', 'Junior Ranger Booklet Available', 'Parking - Auto', 'Recycling', 'Restroom', 'Restroom - Accessible', 'Scenic View/Photo Spot', 'Theater/Auditorium', 'Toilet - Flush', 'Trash/Litter Receptacles', 'Water - Drinking/Potable', 'Wheelchair Accessible'], 'contacts': {'phoneNumbers': [{'phoneNumber': '402-376-1901', 'description': '', 'extension': '', 'type': 'Voice'}, {'phoneNumber': '402-376-1949', 'description': '', 'extension': '', 'type': 'Fax'}], 'emailAddresses': [{'description': '', 'emailAddress': 'niobrara_nsr@nps.gov'}]}, 'directionsInfo': 'The visitor center is located in Valentine, Nebraska, 76 miles south of I-90 (Murdo, SD exit) or 130 miles north of I-80 (North Platte, NE exit) via Hwy 83.', 'directionsUrl': 'http://www.nps.gov/niob/planyourvisit/directions.htm', 'operatingHours': [{'exceptions': [{'exceptionHours': {'wednesday': 'Closed', 'monday': 'Closed', 'th