{'id': '176E2213-D66C-4E09-AFEA-AB093C29744C', 'url': 'http://www.nps.gov/sagu', 'name': 'Rincon Mountain Visitor Center (East)', 'parkCode': 'sagu', 'description': 'At the visitor center, you will find the bookstore, information station, maps and restrooms. The visitor center is also the starting point for a scenic auto/bike tour around the Cactus Forest Loop Drive offering incredible views of the Rincon Mountains. There are several great hikes to do along the drive including the mile loop along the Freeman Homestead Trail to learn about homesteading in the desert.', 'latitude': '32.179659', 'longitude': '-110.736031', 'latLong': '{lat:32.179659, lng:-110.736031}', 'audioDescription': '', 'isPassportStampLocation': '1', 'passportStampLocationDescription': 'Located in the visitor center', 'passportStampImages': [{'credit': '', 'description': '', 'crops': [{'aspectRatio': 1.0, 'url': 'https://www.nps.gov/common/uploads/passport_stamps/primary/5DF76E49-C8D8-D2CA-4B6078F82737C2DE.jpg'}], 'altText': 'RMD Visitor Center passport stamp', 'title': 'RMD Visitor Center passport stamp', 'caption': '', 'url': 'https://www.nps.gov/common/uploads/passport_stamps/5DF76E49-C8D8-D2CA-4B6078F82737C2DE.jpg'}], 'geometryPoiId': '', 'amenities': ['Benches/Seating', 'Bicycle - Rack', 'Cellular Signal', 'Entrance Passes For Sale', 'First Aid Kit Available', 'Gifts/Souvenirs/Books', 'Historical/Interpretive Information/Exhibits', 'Information - Maps Available', 'Information - Ranger/Staff Member Present', 'Information Kiosk/Bulletin Board', 'Parking - Auto', 'Picnic Shelter/Pavilion', 'Recycling', 'Restroom', 'Theater/Auditorium', 'Water - Bottle-Filling Station', 'Wheelchair Accessible'], 'contacts': {'phoneNumbers': [{'phoneNumber': '5207335153', 'description': '', 'extension': '', 'type': 'Voice'}], 'emailAddresses': [{'description': '', 'emailAddress': 'sagu_information@nps.gov'}]}, 'directionsInfo': 'Getting to the Rincon Mountain District from the City of Tucson Travel east on Broad