{'id': '3715AE46-24F1-460B-845B-A67EE868C631', 'url': 'http://www.nps.gov/stri/planyourvisit/visitorcenters.htm', 'name': 'Visitor Center', 'parkCode': 'stri', 'description': 'The visitor center offers a museum, a movie about the battle, and a bookstore. From March 1st through October 31st, the Stones River National Battlefield visitor center is open from 9 AM to 5 PM daily. From November 1st through February 28th visitor center hours are 9 AM to 4 PM daily. The visitor center is closed on Thanksgiving and December 25th.', 'latitude': '35.8806525', 'longitude': '-86.4348727', 'latLong': '{lat:35.8806525, lng:-86.4348727}', 'audioDescription': 'The entrance to the parking lot includes a circle drive with parking and two accessible spaces close to the Visitor Center. Approaching the building there is a bench, wayside exhibits, and bins for trash and recycling. The Visitor Center is a gray stone one-story building with a green metal roof and flagpole out front. There are two sets of double doors. The left set of doors lead to the restroom lobby. Upon entering the lobby, to the viewer’s left there is a women’s restroom, a drinking fountain, a family accessible restroom, and men’s restroom. There is braille on each of these signs. There is a wood bench on the viewer’s right, against the wall. Straight ahead, there is an exit. Outside, there is a second set of doors to the viewer’s right. These doors are the main entrance to the Visitor Center, and they are automatic. To the right of this is a wooden Stones River National Battlefield sign with the National Park Service arrowhead logo. The Visitor Center lobby is through two sets of automatic doors. Upon entering a large octagonal lobby, on the viewer’s left is an information desk. To the right is the gift shop. Straight ahead is the first gallery of the museum. Past the information desk to the far left is an emergency exit and temporary exhibit. The first gallery covers the time period before the Battle of Stones River. Walls are lined with exhibit text and graphics. To the viewer’s right is a three-dimensional exhibit with a Confederate soldier sitting outside of a tent, writing in a diary. He is wearing a butternut colored jacket, and blue pants with a tan colored hat. This exhibit has an audio component via a button to the right of the exhibit. To the left of the camp exhibit, is another describing Union and Confederate soldiers. On display are Union and Confederate uniforms and items. In the case to the viewer’s right is a navy blue Union coat with personal items a soldier once carried. To the viewer’s left is a gray Confederate coat with items carried by the common soldier. To the left of this is an exhibit describing military music with instruments on display. This exhibit plays Civil War music with the touch of a button. To the far left is an exhibit on new technology with a touchable telegraph and musket on display. Exiting gallery one, to viewers right a hallway leads to gallery two. Walls are lined with exhibit text and artifacts including munitions and personal items. This gallery covers the three-day Battle of Stones River. Gallery two is a circular room. To viewers right, there is a three-dimensional exhibit of two Union soldiers with a disabled cannon which was used during the battle. A few steps into the gallery there is a diorama on the left wall audio describing an event called Hell’s Half Acre. Visitors can operate this diorama via a button located below the diorama. When entering gallery three, to the viewer’s left there is an exhibit case with medical instruments. Gallery three covers the battle’s aftermath and Reconstruction. There is exhibit text on the left wall describing the wounded and the dead. To the right of this text are two exhibit cases with original soldier’s coats on display. These coats are from men who were killed at the battle. To the viewer’s right in the corner there are blown up newspaper articles mounted to the wall. To the left of the newspapers is an interactive display on Fortress Rosecrans. This display is a map on a slanted table and has an audio component describing some of its history. The buttons to operate the audio are located close to the edge of the table. Past the Fortress Rosecrans exhibit, to the viewers left on the far wall is a large exhibit case with a cannon inside also used during the Battle of Stones River. A medal of honor is displayed above the cannon. To the viewers left of the cannon is the Hazen Brigade monument exhibit with artifacts on display. The remaining walls in this gallery are lined with graphics and text describing this period. Exiting gallery three, you will find the gift shop. Shelves with items related to the park service and the battle line the walls. In this gift shop there are books related to the battle and the Civil War, souvenirs and clothing. There are additional items for purchase on display in the center of the room. There is an emergency exit in the back of the room. Exiting the gift shop into the lobby and past the information desk is a long hallway to the far left, which leads into the restroom lobby and building exit.', 'isPassportStampLocation': '1', 'passportStampLocationDescription': 'Stones River NB has an array of stamps including: Standard Cancellation, Park Logo, Fortress Rosecrans, Stones River National Cemetery, Tennessee Civil War NHA, Trail of Tears, Underground Railroad Network and 19th Amendment Centennial.', 'passportStampImages': [{'credit': '', 'description': '', 'crops': [{'aspectRatio': 1.0, 'url': 'https://www.nps.gov/common/uploads/passport_stamps/primary/272927E8-E2AE-7E00-4678C147C5098E5B.jpg'}], 'altText': 'A purple circle with Stones River National Battlefield Murfreesboro, TN typed inside', 'title': 'Stones River NB Cancellation Stamp', 'caption': '', 'url': 'https://www.nps.gov/common/uploads/passport_stamps/272927E8-E2AE-7E00-4678C147C5098E5B.jpg'}, {'credit': '', 'description': '', 'crops': [{'aspectRatio': 1.0, 'url': 'http