{'id': 'AFF59438-A70F-42C6-8F51-1CC4FD1F6780', 'url': 'http://www.nps.gov/heho/planyourvisit/visitorcenters.htm', 'name': 'Visitor Center', 'parkCode': 'heho', 'description': 'Start your visit at the Visitor Center, where park rangers are available to answer questions and help you get oriented. Allow yourself about 30 minutes in the Visitor Center, which is open from 9:00 a.m. to 5:00 p.m. daily.', 'latitude': '41.670864', 'longitude': '-91.345702', 'latLong': '{lat:41.670864, lng:-91.345702}', 'audioDescription': 'Visitor Center. 1 ¾ minutes. The Visitor Center for the Herbert Hoover National Historic Site is located at the northeast corner of the historic site, near the intersection of Parkside Drive and Main Street. There is a parking area on the south side of the visitor center, and the building’s entrance faces the parking lot. From the parking lot, the building presents a façade of glass and multi-hued red bricks. It’s one story high and the design is modern and angular. There is a pitched roof, but the angle of the roof is greater on the left side than the right, so the two halves do not meet at a point; instead the peak of the left-hand portion sticks up about six feet higher in the center. The left-hand side is brick and windowless. In grey raised metal the words “Herbert Hoover National Historic Site” and the National Park Service arrowhead logo are affixed to the brick. The entrance is on the right-hand side—through double glass doors set into a larger tinted-glass vestibule. A ramp provides access to the doors from the left side of the parking lot, rising up along the front of the building. The front doors have an automatic open button on their left. Inside, you’ll find an introductory film, exhibits, a gift shop, and additional information about the park. A ranger is stationed at the main desk opposite the entrance. End of message.', 'isPassportStampLocation': '1', 'passportStampLocationDescription': '', 'passportStampImages': [{'credit': '', 'descripti